import React from 'react';
export default function Social(){
    return (
         <div className="home__social">
            <a href = "https://github.com/chloepn" className ="home__social-icon" target = "_blank" >
                <i class="uil uil-github-alt"></i>
            </a>
            <a href = "https://www.linkedin.com/in/chloe-phan/" className ="home__social-icon" target = "_blank" >
                <i class="uil uil-linkedin-alt"></i>
            </a>
         </div>
    );
}
